subSubSection.paragraph:
Redescription . Length 6.0–11.0 mm. Body black to dark brown, antennae and legs dark brown. Head (
Fig. 1
). Clypeus and frons with round punctures each with a central seta; antennae reaching midpoint of lateral margin of pronotum; antennomere 9 longer than wide, with apical tomentose sensory patches arranged in two areas separated dorsally; antennomere 10 as wide as antennomere 11 . Thorax. Pronotum widest behind midpoint; disc glabrous, lateral quarters with fine, golden setae; punctures of disc same size as punctures of elytron; width of anterior margin not exceeding half the width of posterior margin; lateral quarters convex, dorsal surface of lateral margin bearing a row of short golden setae; posterior angles acute, apex pointed; prosternum horizontal, with edge on anterior margin broadened below gula; prosternal process produced backwards, not reaching the midpoint of the space between pro– and mesocoxae (as in
Fig. 13
); prosternum and mesosternum with punctures. Elytron lacking carinae, with a narrow groove over lateral margin, occupying only outer sixth of elytra, bearing short, broad, golden, scaly setae; dorsal surface with short golden setae; pseudopleuron with long setae arising on punctures; epipleuron with short setae arising on protuberances, lacking a row of setae on the edge of anterior quarter. Legs. Ventral surface of meso– and metafemora lacking a row of setae on posterior edge. Internal surface of meso– and metatibiae with short, stout setae. Metatibiae straight. Male genitalia. Rods of sterna IX “V”-shaped. Basal lamina of tegmen equal width throughout, with base concave. Lateral styles of tegmen with proximal margin ventrally bisinuate, widest at base, with setae on distal half of ventral surface. Median lobe moderate (0.75 <L/T ≤ 1.00), distally broadened, with apical aperture large and apex rounded. Female genitalia. Paraprocts moderate (1.2 ≤ P/C ≤ 2.0); baculi of coxite inclined 45 °; proctigeral baculus extending proximad much beyond paraproct baculus; apicodorsal lobe of proctiger extending about ½ length of coxite.
